class Solution(object):
    def getMaxFunctionValue(self, receiver, k):
        """
        :type receiver: List[int]
        :type k: int
        :rtype: int
        """
        n = len(receiver)
        max_value = 0
        dp = [-1] * n

        for i in range(n):
            if dp[i] != -1:
                continue

            cycle = []
            visited = set()
            current = i

            while current not in visited:
                visited.add(current)
                cycle.append(current)
                current = receiver[current]

                if dp[current] != -1:
                    for j in range(len(cycle)):
                        dp[cycle[j]] = dp[current] + len(cycle) - j
                    break

            if current in visited:
                cycle_start = cycle.index(current)
                cycle_length = len(cycle) - cycle_start

                for j in range(len(cycle)):
                    if j < cycle_start:
                        dp[cycle[j]] = len(cycle) + k // cycle_length * cycle_length - cycle_start
                    else:
                        dp[cycle[j]] = j - cycle_start + 1 + k // cycle_length * cycle_length

            max_cycle_value = max(dp[cycle[j]] for j in range(len(cycle)))
            max_value = max(max_value, max_cycle_value)

        return max_value
